/// <summary>
///    Gets the last updated journal for the <c>SalesTable</c>.
/// </summary>
void  lastJournals()
{
    container  lastJournals;

    if (salesTable.DocumentStatus || salesTable.QuotationId)
    {
        lastJournals = salesTable.lastJournals();

        [lastQuotation,     lastQuotationDate]      = conpeek(lastJournals, SalesTableType::posQuotation());
        [lastConfirmed,     lastConfirmedDate]      = conpeek(lastJournals, SalesTableType::posConfirmation());
        [lastPicked,        lastPickedDate]         = conpeek(lastJournals, SalesTableType::posPickingList());
        [lastPackingSlip,   lastPackingSlipDate]    = conpeek(lastJournals, SalesTableType::posPackingSlip());
        [lastInvoiced,      lastInvoicedDate]       = conpeek(lastJournals, SalesTableType::posInvoice());

        [lastPreparation,   lastPreparationDate]    = conpeek(lastJournals, SalesTableType::RORPosPreperation());
        [lastOutbound,      lastOutboundDate]       = conpeek(lastJournals, SalesTableType::RORPosOutbound());

        [lastBuild,         lastBuildDate]          = conpeek(lastJournals, SalesTableType::RORPosBuild());
        [lastEventStart,    lastEventStartDate]     = conpeek(lastJournals, SalesTableType::RORPosEventStart());
        [lastEventEnd,      lastEventEndDate]       = conpeek(lastJournals, SalesTableType::RORPosEventEnd());
        [lastStrike,        lastStrikeDate]         = conpeek(lastJournals, SalesTableType::RORPosStrike());
        [lastInbound,       lastInboundDate]        = conpeek(lastJournals, SalesTableType::RORPosInbound());

        [lastReturned,      lastReturnedDate]       = conpeek(lastJournals, SalesTableType::RORPosReturned());
        [lastInspection,    lastInspectionDate]     = conpeek(lastJournals, SalesTableType::RORPosReturnInspection());
    }
}

